import { Grid } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';

import '../../style/menu.css';
import icon from '../../photo/ikonkaInicialy.jpeg';
function Menu() {
  return (
    <Grid
      container
      direction="row"
      justifyContent="space-between"
      alignItems="center"
      className="menu"
    >
      <Grid
        container
        direction="row"
        justifyContent="flex-start"
        alignItems="center"
        xs={4}
      >
        <img
          src={icon}
          alt={'Profile photo'}
          width="50px"
          style={{ borderRadius: '200px' }}
        />
      </Grid>
      <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="center"
        xs={4}
      >
        <Grid item>
          <Button>
            <HomeIcon
              style={{
                color: 'white'
              }}
            />
          </Button>
        </Grid>
        <Grid item>{'Menu 2'}</Grid>
        <Grid item>{'Menu 3'}</Grid>
        <Grid item>{'Menu 4'}</Grid>
      </Grid>
      <Grid
        container
        direction="row"
        justifyContent="flex-end"
        alignItems="center"
        xs={4}
      >
        <Grid item>{'Contact'}</Grid>
      </Grid>
    </Grid>
  );
}

export { Menu };
